import React from "react";
import { Grid, Segment } from "semantic-ui-react";

const PublicJokeCard = (props, color) => {
    return (
        <Grid.Column className="public-card">
            <Segment className={color}>{props.props.id}. {props.props.title}{"  "}{props.props.joke}</Segment>
        </Grid.Column>
    )
}

export default PublicJokeCard;
